//AQUI ESTÁ LA APLICACIÓN, esta es una componenete, cada una de estas tiene su propio css

import React from 'react'; //IMporta react
import logo from './logo.svg';//Logo
import './App.css'; // Importa css

//COMPONENTE APP
// La clase es una representacion de una parte de la página
function App() {
  return (
    // Todo debe estar encerrado por na etiqueta
    //Para no confundir con class se usa className
    <div className="App">
      <nav ClassName="nav nav-tabs nav-stacked">
        <a ClassName="nav-link active" href="#">Active link</a>
        <a ClassName="nav-link" href="#">Link</a>
        <a ClassName="nav-link disabled" href="#">Disabled link</a>
      </nav>
    </div>
  );
}

export default App;
